import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Navigation from './Navigation';
import Home from './Home';
import About from './About'; // Add the import statement for the About page
import Products from './Products'; // Add the import statement for Products
import Contact from './Contact'; // Add the import statement for Contact

function App() {
  return (
    <Router>
      <div>
        <Navigation />


          <Route exact path="/" component={About} /> {/* About page as the default page */}
          <Route path="/home" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/products" component={Products} />
          <Route path="/contact" component={Contact} />
          {/* Add more routes for other sections/pages */}

      </div>
    </Router>
  );
}

export default App;
